import styled from "styled-components";
import { useSelector, useDispatch } from "react-redux";

const TodoBox = styled.div`
  max-width: 1150px;
  background-color: white;
  margin: auto;
  border: 1px solid transparent;
  border-radius: 10px;
`;
const me = [
  { name: "1", box: "2" },
  { name: "1", box: "2" },
  { name: "1", box: "2" },
  { name: "1", box: "2" },
];
const Todo = () => {
  const todolist = useSelector((state) => state.todos.todolist);
  console.log(todolist);

  return (
    <div>
      <TodoBox>
        {me.map((todolists) => {
          <div key={todolists.name}>
            <div>
              <h2>{todolists.name}</h2>
              <span>{todolists.box}</span>
            </div>
            <button>삭제하기</button>
            <button>취소 </button>
          </div>;
        })}
      </TodoBox>
    </div>
  );
};

export default Todo;
